  \"2016-03-17T20:52:19.861703\",\n\t\"name\": \"taxable-property-values-by-tax-district-and-year\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains taxable property
  values for classes of real property by tax district. Taxable values are based on
  assessed valuations after application of the statutory assessment limitation (i.e.
  rollback), and is the value to which tax rates are applied (e.g. 2012 net taxable
  valuations are used for the FY 2014 property tax levies).  Real property is mostly
  land, buildings, structures, and other improvements that are constructed on or in
  the land, attached to the land, or placed upon a foundation. Typical improvements
  include a building, house or mobile home, fences, and paving. Classes of real property
  include the following: Residential, Agricultural Land, Agricultural Buildings, Commercial,
  Industrial, Utilities and Railroads.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
